import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Notes from './Notes';
import * as serviceWorker from './serviceWorker';
import { Route, Link, BrowserRouter as Router} from 'react-router-dom'
import Navbar from 'react-bootstrap/Navbar';
import { Button, NavDropdown, Nav, Card } from 'react-bootstrap';
i
const routing = (
  <Router>
      <div>
        <Navbar>
            <Navbar.Brand>React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="mr-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#test">Notes</Nav.Link>
                <NavDropdown title="Teaching" id="basic-nav-dropdown">
                  <NavDropdown.Item href="#action/3.1">Spring 2020</NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.2">Fall 2019</NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.3">Summer 2019</NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item href="#action/3.4">CSM Spring 2020</NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.4">CSM Fall 2019</NavDropdown.Item>
                </NavDropdown>
              </Nav> 
            </Navbar.Collapse>
        </Navbar>
        <Route exact path='/' component={App} />
        <Route path='/notes' component={Notes} />
      </div>
  </Router>
)
ReactDOM.render(routing, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
